def BW_ReportedDeaths(debug=False):
	start_key = min(ending.keys())
	start = min(ending.values())
	start = start - datetime.timedelta(days=len(deaths_rev[start_key]))
	end = max(ending.values())
	n_dates = (end-start).days+1
	n_pubs = len(deaths_rev)

	spubs = []
	deaths = np.zeros((n_pubs,n_dates,),dtype="int32")
	for ki,k in enumerate(list(sorted(deaths_rev.keys()))[:]):
		dend = ending[k]
		iend = (dend-start).days
		spubs.append(dend)
		
		for di,d in enumerate(deaths_rev[k]):
			for pi in range(ki,n_pubs):
				deaths[pi,iend-di] = d
	
	if debug:
		for i,l in enumerate(deaths[:,370:450]):
			print(spubs[i],list(l))
#	print(list(deaths[:30,:30]))
	
	dts = pd.date_range(start,end,freq="D")
	print(deaths.shape,len(dts),len(spubs))
	xdeaths = xr.DataArray(deaths,dims=("publication","date",),coords={"publication":spubs,"date":dts})
	return xdeaths
	
def main():
	BW_ReportedDeaths(True)

if __name__ == '__main__':
	
	main()




